13916	Death Note	Light Yagami é um genial estudante entediado com a vida que leva. Mas tudo está prestes a mudar. Light encontra um misterioso caderno chamado Death Note e descobre que com ele é possível matar quem quiser. O rapaz então decide varrer a escória da sociedade do planeta. Dotado de grande senso de justiça, ele começa a usar o caderno maldito para eliminar criminosos do mundo inteiro e começa a ganhar notoriedade na internet e nos demais meios de comunicação. Os atos do estudante são vistos com bons olhos por muitas pessoas que, sem saber sua identidade, passam a chamá-lo de Kira, do inglês "Killer" (assassino). Mas Light também chama a atenção das autoridades mundiais. Entra em cena o exótico detetive L. O confronto intelectual entre os dois é intenso até que Light, manipulando a todos, consegue tirar seu oponente de seu caminho. No entanto, o legado de L é herdado por seus sucessores Mello (M) e Near (N). Até onde Kira irá conseguir ir com seus planos de criar um novo mundo sem crimes?	64.2519999999999953	/ewHMpGo46KFHxYh50SxDusjTVM9.jpg	/A2j5g79EcWn1oTNCW9PSo7NZRfv.jpg	37	1	8.30000000000000071	565	13916	2019-08-29 01:11:00.497+00	2019-08-29 01:11:00.497+00
46260	Naruto	Doze anos antes do início da série, um monstro conhecido como Raposa de Nove Caudas (Kyuubi) atacou a aldeia de Konoha, destruindo grande parte da aldeia e tirando muitas vidas. O líder da aldeia, o quarto Hokage, sacrificou a sua vida para selá-la em um recém-nascido, Naruto Uzumaki. Órfão por causa do ataque, Naruto sempre é evitado pelos moradores, que por medo e raiva, veem-no como o próprio Nove Caudas. Com sua sede por reconhecimento, Naruto jura que um dia se tornará o maior Hokage da aldeia.	98.2579999999999956	/lTVhwFcSHqN0Xv8HLxDHILtrwfX.jpg	/iTHCRCwI810e39uy4QsByWmUN8z.jpg	220	4	7.70000000000000018	245	46260	2019-08-29 01:33:28.598+00	2019-08-29 01:33:28.598+00
37854	One Piece	Houve um homem que conquistou tudo aquilo que o mundo tinha a oferecer, o lendário Rei dos Piratas, Gold Roger. Capturado e condenado à execução pelo Governo Mundial, suas últimas palavras lançaram legiões aos mares. "Meu tesouro? Se quiserem, podem pegá-lo. Procurem-no! Ele contém tudo que este mundo pode oferecer!". Foi a revelação do maior tesouro, o One Piece, cobiçado por homens de todo o mundo, sonhando com fama e riqueza imensuráveis... Assim começou a Grande Era dos Piratas!	53.0379999999999967	/oag7edI9flSMawmNySEiSEJAbrf.jpg	/xgs7zAF5VSGAK0QstH1Q0ivybXz.jpg	902	21	7.70000000000000018	266	37854	2019-08-30 00:48:04.658+00	2019-08-30 00:48:04.658+00
